          <Row>
            <Col
              xs={12}
              sm={12}
              style={{ display: 'flex', justifyContent: 'center' }}
            >
              {/* <div
                onClick={() => {
                  this.setState(prev => {
                    return { agreed: !prev.agreed };
                  });
                }}
                style={{ marginRight: 10 }}
              >
                <i
                  className={
                    this.state.agreed ? 'fas fa-check-square' : 'far fa-square'
                  }
                  style={{ fontSize: 24, cursor: 'pointer' }}
                ></i>
              </div>*/}
              {/*<div>
                I agree to{' '}
