                  cursor: 'pointer',
                }}
              >
                PREV
              </div>
            </Col>
            <Col xs={6}>
              <button
                type="submit"
                // onClick={()=>this.props.handlePageChange(3)}
                style={{
                  marginTop: 10,
                  width: '100%',
                  opacity: filled ? 1 : 0.8,
                  pointerEvents: filled ? 'auto' : 'none',
                }}
              >
                START
              </button>
            </Col>
          </Row>
        </Container>
      </Fade>
    );
  }
}
